import React, { useState } from "react";
import axios from "axios";
import "../styles/WeatherForecast.css";
import WeatherIcon from "./WeatherIcon";
import FormattedTime from "./FormattedTime";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faLongArrowAltUp,
  faLongArrowAltDown,
} from "@fortawesome/free-solid-svg-icons";

export default function WeatherForecast(props) {
  let [loaded, setLoaded] = useState(false);
  let [forecast, setForecast] = useState(null);
  const apiKey = "17f56a92dfdfe63b71c98d96a2a4942a";
  let lon = props.coordinates.lon;
  let lat = props.coordinates.lat;
  let apiUrl = `https://api.openweathermap.org/data/2.5/onecall?lat=${lat}&lon=${lon}&appid=${apiKey}&units=metric`;

  function handleResponse(response) {
    setForecast(response.data);
    setLoaded(true);
  }
  if (loaded && forecast.lat === lat && forecast.lon === lon) {
    return (
      <div className='weatherForecast'>
        <div className='container-fluid'>
          <ul className='forecast'>
            <li className='p-1'>
              <p>
                {<FormattedTime date={new Date(forecast.daily[0].dt * 1000)} />}
              </p>
              <WeatherIcon code={forecast.daily[0].weather[0].icon} size={40} />
              <p>
                <FontAwesomeIcon icon={faLongArrowAltUp} size='xs' />{" "}
                {Math.round(forecast.daily[0].temp.max)}°{" "}
                <FontAwesomeIcon icon={faLongArrowAltDown} size='xs' />{" "}
                {Math.round(forecast.daily[0].temp.min)}°{" "}
              </p>
            </li>
            <li className='p-1'>
              <p>16:00</p>
              <WeatherIcon code='01d' size={40} />
              <p>
                <FontAwesomeIcon icon={faLongArrowAltUp} size='xs' /> 18°{" "}
                <FontAwesomeIcon icon={faLongArrowAltDown} size='xs' /> 10°
              </p>
            </li>
            <li className='p-1'>
              <p>16:00</p>
              <WeatherIcon code='01d' size={40} />
              <p>
                <FontAwesomeIcon icon={faLongArrowAltUp} size='xs' /> 18°{" "}
                <FontAwesomeIcon icon={faLongArrowAltDown} size='xs' /> 10°
              </p>
            </li>
            <li className='p-1'>
              <p>16:00</p>
              <WeatherIcon code='01d' size={40} />
              <p>
                <FontAwesomeIcon icon={faLongArrowAltUp} size='xs' /> 18°{" "}
                <FontAwesomeIcon icon={faLongArrowAltDown} size='xs' /> 10°
              </p>
            </li>
            <li className='p-1'>
              <p>16:00</p>
              <WeatherIcon code='01d' size={40} />
              <p>
                <FontAwesomeIcon icon={faLongArrowAltUp} size='xs' /> 18°{" "}
                <FontAwesomeIcon icon={faLongArrowAltDown} size='xs' /> 10°
              </p>
            </li>
            <li className='p-1'>
              <p>16:00</p>
              <WeatherIcon code='01d' size={40} />
              <p>
                <FontAwesomeIcon icon={faLongArrowAltUp} size='xs' /> 18°{" "}
                <FontAwesomeIcon icon={faLongArrowAltDown} size='xs' /> 10°
              </p>
            </li>
          </ul>
        </div>
      </div>
    );
  } else {
    axios.get(apiUrl).then(handleResponse);
    return "Loading";
  }
}
